import React from 'react'
import './post.css';
import Avatar from "@material-ui/core/Avatar";

function Post() {
    return (
    <div className="post">
          
          <div className="post_header">
            
             <Avatar
             className="post_avatar"
             alt="AmanKumar"
             source="/static/images/avatar/1.png"
             />
             <h3>Username</h3>
        
        </div>
             {/* header -> avatar + username*/}

        
             <img className="post_image" altsrc="images/size/w200"></img>
                {/* image */}
             <h4 className="post_text"><strong>AMAN</strong>Using reactjs</h4>
             {/* username + caption */}
           
    </div>
 
    )
}

export default Post
